HQ promo music video. &quot;Going Back to Cali&quot; is single by LL Cool J from the 
&quot;Less Than Zero&quot; soundtrack and his third album Walking with a Panther. 

Produced by Rick Rubin and LL Cool J, the song was a success, peaking at #31 
on the Billboard Hot 100 and #12 on the Hot R&amp;B/Hip-Hop Songs, and was eventually certified gold by the RIAA on May 28, 1991.
